module Wires
    (
        Wire (..),
        newWire,
        toCoords,
        fromCoords,
        extendPathSeg,
        fromPath,
        fromPathStr,
        manhattanDist,
        tipDistance,
        intersections,
        smallestIntersectDistOfPaths
    ) where

import Util
import Data.List

class Vector a where
    add, sub :: a -> a -> a

data Point = Pt Int Int
instance Vector Point where
    add (Pt a b) (Pt x y) = Pt (a+x) (b+y) 
    sub (Pt a b) (Pt x y) = Pt (a-x) (b-y)
instance Eq Point where
    (Pt a b) == (Pt x y) = (a == x) && (b == y)
instance Show Point where
    show (Pt a b) = show (a, b)

data Wire = Wire [Point]
instance Show Wire where
    show (Wire ps) = show ps
instance Eq Wire where
    (Wire as) == (Wire bs) = as == bs
    
data Direction = Up | Down | L | R

origin :: Point
origin = Pt 0 0

newWire :: Wire
newWire = Wire [origin]

pointFromTuple :: (Int, Int) -> Point
pointFromTuple (x, y) = Pt x y

pointToTuple :: Point -> (Int, Int)
pointToTuple (Pt x y) = (x, y)

toPoints :: Wire -> [Point]
toPoints (Wire ps) = ps

toCoords :: Wire -> [(Int, Int)]
toCoords = (map pointToTuple) . toPoints

fromCoords :: [(Int, Int)] -> Wire
fromCoords ps = Wire (map pointFromTuple ps)

addFromTip :: Wire -> Point -> Point
addFromTip (Wire ps) = add (head ps)

addPoint :: Wire -> Point -> Wire
addPoint (Wire ps) p = Wire (p:ps)

extendWithPt :: Point -> Wire -> Wire
extendWithPt p w = addPoint w (addFromTip w p)

unitVec :: Direction -> Point
unitVec Up = Pt 0 1
unitVec Down = Pt 0 (-1)
unitVec L = Pt (-1) 0
unitVec R = Pt 1 0

extend :: Direction -> Wire -> Wire
extend d = extendWithPt (unitVec d)

extendLength :: Direction -> Int -> Wire -> Wire
extendLength d 0 w = w
extendLength d l w = extendLength d (l-1) (extend d w)

charToDir :: Char -> Direction
charToDir 'U' = Up
charToDir 'D' = Down
charToDir 'L' = L
charToDir 'R' = R
charToDir _ = error "Invalid Direction Character"

extendPathSeg :: String -> Wire -> Wire
extendPathSeg s =
    let d:l = s in
        extendLength (charToDir d) (strToInt l)

extendPath :: Wire -> [String] -> Wire
extendPath w [] = w
extendPath w (x:xs) = extendPath (extendPathSeg x w) xs

fromPath :: [String] -> Wire
fromPath = extendPath newWire

fromPathStr :: String -> Wire
fromPathStr = fromPath . (splitOn ',')

manhattanDist :: Point -> Int
manhattanDist (Pt x y) = x + y

tipDistance :: Wire -> Int
tipDistance = manhattanDist . head . toPoints

intersections :: Wire -> Wire -> [Point]
intersections (Wire a) (Wire b) = delete origin (intersect a b) -- remove origin intersection because starting intersection doesn't count

closestIntersectionDist :: Wire -> Wire -> Int
closestIntersectionDist a b = foldr1 min $ map manhattanDist (intersections a b)

smallestIntersectDistOfPaths :: String -> String -> Int
smallestIntersectDistOfPaths a b = 
    let x = fromPathStr a
        y = fromPathStr b in
        closestIntersectionDist x y

toPointsUnique :: Wire -> [Point]
toPointsUnique = nub . toPoints

